	add("grabass", "{\"term\":\"grabass\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|grab|ass|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Horseplay; play fighting, wrestling. Any sort of playful or casual activity that might be mistaken for fighting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;There\u0027s no playing grab-ass or fighting in the building. You got a grudge against another man, you fight him Saturday afternoon. Any man playing grab-ass or fighting in the building spends a night in the box.\u0026quot; - \u0027Cool Hand Luke\u0027, film\", \"priority\":2}]}, \"synonyms\":{}}");

	add("grace", "{\"term\":\"grace\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"French\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027grace\u0027 from Old french (842-ca. 1400) \u0027grace\u0027 (Modern French \u0027gr√¢ce\u0027 , from Latin {{m|la|grƒÅtia}} \u0026quot;kindness, favour, esteem\u0026quot;, from {{m|la|grƒÅtus}} ‚Äòpleasing‚Äô from Proto-indo-european {{m|ine-pro|*gwer-||to praise, welcome}}. Compare {{l|en|grateful}}. Displaced native Middle english (1100-1500) \u0027held\u0027 \u0027hield\u0027 \u0026quot;grace\u0026quot; (from Old english (ca. 450-1100) \u0027held\u0027 \u0027hyld\u0027 \u0026quot;grace\u0026quot;), Middle english (1100-1500) \u0027este\u0027 \u0026quot;grace, favour, pleasure\u0026quot; (from Old english (ca. 450-1100) {{m|ang|ƒìste}} \u0026quot;grace, kindness, favour\u0026quot;), Middle english (1100-1500) \u0027athmede\u0027 \u0026quot;grace\u0026quot; (from Old english (ca. 450-1100) {{m|ang|ƒìadmƒìdu}} \u0026quot;grace\u0026quot;), Middle english (1100-1500) \u0027are\u0027 \u0027ore\u0027 \u0026quot;grace, mercy, honour\u0026quot; (from Old english (ca. 450-1100) {{m|ang|ƒÅr}} \u0026quot;grace, kindness, mercy\u0026quot;).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Elegant movement; poise or balance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Charming, pleasing qualities\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1699\u0027\u0027, \u0027[http://essays.quotidiana.org/temple/heads_for_conversation/ Heads designed for an essay on conversations\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Study gives strength to the mind; conversation, \u0027\u0027grace\u0027\u0027: the first apt to give stiffness, the other suppleness: one gives substance and form to the statue, the other polishes it\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I have formerly given the general character of Mr. Addison\u0027s style and manner as natural and unaffected, easy and polite, and full of those \u0027\u0027graces\u0027\u0027 which a flowery imagination diffuses over writing\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Free and undeserved favour, especially of God. Unmerited divine assistance given to humans for their regeneration or sanctification\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Divine assistance in resisting sin\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Short prayer of thanks before or after a meal\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An allowance of time granted for a debtor during which he is free of at least part of his normal obligations towards the creditor\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A special move in a solitaire or patience game that is normally against the rules\", \"priority\":10}]}, \"synonyms\":{}}");

	add("grace", "{\"term\":\"grace\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From the noun grace, first used by Puritans in the 16th century. In Roman Catholic use it may refer to {{w|Our Lady of Graces}}, cognate with Italian Grazia.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1648\u0027\u0027 w:Robert Herrick Robert Herrick, \u0027Hesperides\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"To The Handsome Mistress \u0027\u0027Grace\u0027\u0027 Potter: As is your name, so is your comely face / Touch\u0027d everywhere with such a diffused grace\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1839\u0027\u0027 George William MacArthur Reynolds: \u0027Grace Darling, or the Heroine of the Fern Islands\u0027: page 24\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Grace\u0027\u0027 does not belie her name; for she is indeed a sweet girl, modest and unassuming, and appearing to be unconscious of having done anything great or noble. - OBSERVER, \u0027Dec.16, 1838\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1965\u0027\u0027 w:Naomi Long Naomi Long Madgett: \u0027Her Story\u0027, \u0027Star By Star\u0027, Harlo Press\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"They named me \u0027\u0027Grace\u0027\u0027 and waited for a light and agile dancer. / But some trick of genes mixed me up / And instead I turned out big and black and burly\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027 Deborah Paul, \u0027Amazing Grace\u0027, June 2002, page 249\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Had I given birth to a daughter of my own, I\u0027d like to have called her \u0027\u0027Grace\u0027\u0027, a classic and poetic name, one that illuminates a person of dignity and poise\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A city in Idaho\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"An unincorporated community in Kentucky\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"An unincorporated community in Mississippi\", \"priority\":11}]}, \"synonyms\":{}}");

