	add("grade", "{\"term\":\"grade\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|fr|grade||a grade, degree|lang\u003den}}, from Latin {{m|la|gradus||a step, pace, a step in a ladder or stair, a station, position, degree}}, from {{m|la|gradi||to walk, step}}, from Proto-indo-european {{m|ine-pro|*g ∞rad ∞-}}, {{m|ine-pro|*g ∞red ∞-||to walk, go}}. Cognate with Gothic {{m|got|êå≤êçÇêåπêå∏êçÉ||step, grade}}, Bavarian {{m|bar|Gritt||step, stride}}, Lithuanian {{m|lt|gr√¨diju||to go, wander}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rating\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The performance of an individual or group on an examination or test, expressed by a number, letter, or other symbol; a score\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A degree or level of something; a position within a scale; a degree of quality\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"There are a lot of varieties of diatomaceous earth, so when you are shopping, be sure to get the right stuff!\u0026lt;br\u0026gt;\u0026lt;br\u0026gt;Make sure that you get \u0027\u0027food grade\u0027\u0027 diatomaceous earth. Some people make 3% of the food they eat be diatomaceous earth. There are claims at parasite control, longevity and all sorts of perks. I know that food \u0027\u0027grade\u0027\u0027 diatomaceous earth is used heavily in storing grains - so you are probably already eating lots of diatomaceous earth every time you eat any bread, pasta or other grain based food.\u0026lt;br\u0026gt;\u0026lt;br\u0026gt;Farmers feed food \u0027\u0027grade\u0027\u0027 diatomaceous earth to their animals to reduce parasites and provide other benefits\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This fine-\u0027\u0027grade\u0027\u0027 coin from 1837 is worth a good amount\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A slope (up or down) of a roadway or other passag\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A level of pre-collegiate education\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A student of a particular grade (used with the grade level\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An area that has been \u0027\u0027graded\u0027\u0027 by a grader (construction machine\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The level of the ground\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A gradian\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In a linear system of divisors on an \u0027n\u0027-dimensional variety, the number of free intersection points of \u0027n\u0027 generic divisors\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A harsh scraping or cutting; a grating\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027grade\u0027\u0027 of hatchets fiercely thrown / On wigwam-log, and tree, and stone\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A taxon united by a level of morphological or physiological complexity that is not a clade\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"medicine) The degree of malignity of a tumor expressed on a scale\", \"priority\":16}]}, \"synonyms\":{}}");

	add("gradation", "{\"term\":\"gradation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sequence of gradual, successive stages; a systematic progression\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A passing by small degrees from one tone or shade, as of color, to another. See Synonyms at nuance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The act of gradating or arranging in grades\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any degree or relative position in an order or series\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I. Taylo\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"the several \u0027\u0027gradations\u0027\u0027 of the intelligent univers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A calibration marking\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A gradual change within one parameter, or an overlapping of two blocks of sound.\u0026lt;!--(DeLone et. al. (Eds.), 1975, chap. 1)--\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Apophony\", \"priority\":9}]}, \"synonyms\":{}}");

