	add("gradient", "{\"term\":\"gradient\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027gradiens\u0027 () present participle of \u0027gradior\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A slope or incline\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A rate of inclination or declination of a slope\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Of a function \u0027y\u0027 \u003d \u0027f\u0027(\u0027x\u0027) or the graph of such a function, the rate of change of \u0027y\u0027 with respect to \u0027x\u0027\u0026lt;br\u0026gt; that is, the amount by which \u0027y\u0027 changes for a certain (often unit) change in \u0027x\u0027 \u0026lt;br\u0026gt; equivalently, the inclination to the X axis of the tangent to the curve of the graph\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The rate at which a physical quantity increases or decreases relative to change in a given variable, especially distance\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A differential operator that maps each point of a scalar field to a vector pointed in the direction of the greatest rate of change of the scalar. Notation for a scalar field œÜ: \u0026amp;nabla;\u0026amp;phi\", \"priority\":5}]}, \"synonyms\":{}}");

	add("gradualism", "{\"term\":\"gradualism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|gradual|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The belief that evolution proceeds at a steady pace, without the sudden development of new species or biological features from one generation to the next\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The belief that some phenomenon occurs gradually over a long period of time\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"date\u003d27 November passage\u003dGiven enough time, the logic goes, water can cleave solid rock and mountains can be reduced to plains. This \u0026quot;\u0027\u0027gradualism\u0027\u0027\u0026quot; now underpins modern geologic thought.\u0026amp;nbsp;... Maybe we\u0027ll find evidence that the rock layers are exposed on the flanks of w:Aeolis Mount Sharp [on Mars] not because a river carved through them over millions of years, but because the wind blew against them for billions of years\u0026amp;nbsp;‚Äì the ultimate in gradualism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The belief that change ought to be brought about in small, discrete increments rather than in abrupt strokes such as revolutions or uprisings\", \"priority\":4}]}, \"synonyms\":{}}");

