	add("granite", "{\"term\":\"granite\", \"etymology\":{\"influencers\":[{},{},{},{},{}], \"languages\":[\"English\", \"French\", \"Italian\", \"Latin\"], \"text\":\"From French \u0027granit\u0027 (granite) from Italian \u0027granito\u0027 (granite) from \u0027granire\u0027 (to granulate) from \u0027grano\u0027 (grain) from Latin \u0027granum\u0027 (grain) Compare \u0027granita\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A group of igneous and plutonic rocks composed primarily of feldspar and quartz. Usually contains one or more dark minerals, which may be mica, pyroxene, or amphibole. Granite is quarried for building stone, road gravel, decorative stone, and tombstones. Common colors are gray, white, pink, and yellow-brown\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Toughness; the quality of having a thick skin or being rough\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d18|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003d‚ÄòThen the father has a great fight with his terrible conscience,‚Äô said Munday with \u0027\u0027granite\u0027\u0027 seriousness. ‚ÄòShould he make a row with the police [‚Ä¶]? Or should he say nothing about it and condone brutality for fear of appearing in the newspapers\", \"priority\":3}]}, \"synonyms\":{}}");

