	add("grape", "{\"term\":\"grape\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"German\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"old french (842-ca. 1400)\", \"Proto-Germanic\", \"old high german (ca. 750-1050)\"], \"text\":\"From Middle english (1100-1500) \u0027grape\u0027 from Old french (842-ca. 1400) \u0027grape\u0027 \u0027grappe\u0027 \u0027crape\u0027 (cluster of fruit or flowers, bunch of grapes) from \u0027graper\u0027 \u0027craper\u0027 (to pick grapes) of Proto-germanic origin, from Old Low Frankish {{m|frk|*krapp≈ç||hook}}, from Proto-germanic {{m|gem-pro|*krapp√¥||hook}}, from Proto-indo-european {{m|ine-pro|*grep-||hook}}, {{m|ine-pro|*gremb-||crooked, uneven}}, from Proto-indo-european {{m|ine-pro|*ger-||to turn, bend, twist}}. Cognate with Middle dutch (ca. 1050-1350) \u0027krappe\u0027 (hook) Old high german (ca. 750-1050) \u0027krapfo\u0027 (hook) (German \u0027krapfe\u0027 . More at {{l|en|cramp}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small, round, smooth-skinned edible fruit, usually purple, red, or green, that grows in bunches on vines of genus \u0027Vitis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A woody vine that bears clusters of grapes; a grapevine\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A dark purplish red colour, the colour of many grapes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"grapeshot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A mangy tumour on a horse\u0027s leg\", \"priority\":5}]}, \"synonyms\":{}}");

	add("graph", "{\"term\":\"graph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Shortening of \u0027graphic formula\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A diagram displaying data; in particular one showing the relationship between two or more quantities, measurements or indicative numbers that may or may not have a specific mathematical formula relating them to each other\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A diagram displaying data, in particular one showing the relationship between two or more variables; specifically, for a function \u0026lt;math\u0026gt;f(x_1, x_2, ldots, x_n)\u0026lt;/math\u0026gt;, the set of all tuples \u0026lt;math\u0026gt;(x_1, x_2, ldots, x_n, f(x_1, x_2, ldots, x_n))\u0026lt;/math\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An ordered pair \u0026lt;math\u0026gt;(V,E)\u0026lt;/math\u0026gt;, where \u0026lt;math\u0026gt;V\u0026lt;/math\u0026gt; is a set of elements called vertices\u0027 (or \u0027nodes\u0027) and \u0026lt;math\u0026gt;E\u0026lt;/math\u0026gt; is a set of pairs of elements of \u0026lt;math\u0026gt;V\u0026lt;/math\u0026gt;, called \u0027edges\u0027; informally, a set of vertices together with a set edges that join these vertices\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A character, in particular the abstracted fundamental shape of a character as distinct from its ductus (realization in a particular typeface or handwriting: compare glyph\", \"priority\":4}]}, \"synonyms\":{}}");

	add("grapefruit", "{\"term\":\"grapefruit\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|grape|fruit|lang\u003den}}, an allusion to the grapelike clusters of fruit on the tree. Ciardi proposes another theory. The pummelo\u0027s botanical name was Citrus grandis, meaning \u0026quot;great citrus [fruit]\u0026quot;, due to the large size of the fruits. It would be natural to call the new pummelo variety a \u0026quot;greatfruit\u0026quot;. By saying that name a few times, with its consonant cluster, it sounds like \u0026quot;grapefruit\u0026quot;, and it would easily have morphed to that form. This second suggestion is completely speculative, without attestation, but seems much more reasonable than the equally speculative \u0026quot;grape cluster\u0026quot; theory. Actually, pummelo fruits do not not grow in grapelike clusters.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The tree of the species\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The large spherical tart fruit produced by this tree\", \"priority\":2}]}, \"synonyms\":{}}");

