	add("grapevine", "{\"term\":\"grapevine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|grape|vine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The plant, a vine of genus \u0027Vitis\u0027, on which grapes grow\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A rumor\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An informal person-to-person means of circulating information or gossip\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The Bat‚Äîthey called him the Bat.. Heplayed a lone hand,. Most lone wolves had a moll at any rate‚Äîwomen were their ruin‚Äîbut if the Bat had a moll, not even the \u0027\u0027grapevine\u0027\u0027 telegraph could locate her\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A move in which the feet are alternately placed in front of each other, while both remaining on the ice or ground, incorporating half-turns\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A leglock\", \"priority\":6}]}, \"synonyms\":{}}");

