	add("graphene", "{\"term\":\"graphene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|graphite|ene|alt1\u003dgraph(ite)|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any polycyclic aromatic hydrocarbon having the structure of part of a layer of graphite\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An arbitrarily large-scale, one-atom-thick layer of graphite, an allotrope of carbon, that has remarkable electric characteristics\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"date\u003d13 April passage\u003d\u0027\u0027Graphene\u0027\u0027 is the strongest, thinnest material known to exist. A form of carbon, it can conduct electricity and heat better than anything else. And get ready for this: It is not only the hardest material in the world but also one of the most pliable. Only a single atom thick, it has been called the wonder material. Graphene could change the electronics industry, ushering in flexible devices, supercharged quantum computers, electronic clothing and computers that can interface with the cells in your body\", \"priority\":3}]}, \"synonyms\":{}}");

	add("graphetics", "{\"term\":\"graphetics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A branch of linguistics concerned with the analysis of the physical properties of shapes used in writing\", \"priority\":1}]}, \"synonyms\":{}}");

	add("graphician", "{\"term\":\"graphician\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|graphic|ian|lang\u003den}}, probably by analogy with \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A designer of graphics for computer software\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0026quot;Teemu Lahti\u0026quot;, \u0027We need a graphician\u0027 (discussion on Internet newsgroup \u0027comp.sys.ibm.pc.demos\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I have a demogroup called Kontio and we need a \u0027\u0027graphician\u0027\u0027, who can make 2D and 3D. Our website is not yet online, but it will be someday. Contact me, if you are interested\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, \u0026quot;Lars Sobiraj\u0026quot;, \u0027graphician wanted!\u0027 (discussion on Internet newsgroup \u0027alt.amiga.demos\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Darkage is desperatly searching for a \u0027\u0027graphician\", \"priority\":5}]}, \"synonyms\":{}}");

	add("graphicness", "{\"term\":\"graphicness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|graphic|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being graphic: grotesqueness or vividnes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The sheer \u0027\u0027graphicness\u0027\u0027 of the violence is shocking\", \"priority\":2}]}, \"synonyms\":{}}");

	add("graphite", "{\"term\":\"graphite\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"ancient greek (to 1453)\"], \"text\":\"From German \u0027graphit\u0027 (A.G. Werner 1789), from Ancient greek (to 1453) \u0027Œ≥œÅŒ¨œÜœâ\u0027 (i write)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An allotrope of carbon, consisting of planes of carbon atoms arranged in hexagonal arrays with the planes stacked loosely, that is used as a dry lubricant and in \u0026quot;lead\u0026quot; pencils\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Short for graphite-reinforced plastic, a composite plastic made with graphite fibers noted for light weight strength and stiffness\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Modern tennis racquets are made of \u0027\u0027graphite\u0027\u0027, fibreglass and other man-made materials\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A grey colour\", \"priority\":4}]}, \"synonyms\":{}}");

