	add("graptolite", "{\"term\":\"graptolite\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027Œ≥œÅŒ±œÄœÑœåœÇ\u0027 (painted, marked with letters) {{suffix||lite|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a group of extinct aquatic colonial invertebrates, of the class \u0027Graptolithina\u0027, from the Cambrian and Carboniferous period\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, \u0027The Earth\u0027, Folio Society 2011, p. 70\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The samples were black shale, and on the shales were some ancient fossils called \u0027\u0027graptolites\", \"priority\":3}]}, \"synonyms\":{}}");

	add("grass", "{\"term\":\"grass\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"Faroese\", \"northern frisian\", \"West Frisian\", \"Icelandic\", \"low german\", \"Dutch\", \"scots\", \"saterfriesisch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) {{m|enm|gras}}, {{m|enm|gres}}, {{m|enm|gers}}, from Old english (ca. 450-1100) {{m|ang|gr√¶s}}, {{m|ang|g√¶rs||grass, blade of grass, herb, young corn, hay, plant; pasture}}, from Proto-germanic {{m|gem-pro|*grasƒÖ||grass}}, from Proto-indo-european {{m|ine-pro|*g ∞reH‚ÇÅ-}}, {{m|ine-pro|*«µ ∞reh‚ÇÅ-||to grow}}.{{rel-top|cognates}}Cognate with Scots {{m|sco|girs}}, {{m|sco|gers}}, {{m|sco|gress||grass}}, Northern frisian {{m|frr|g√§√§rs}}, {{m|frr|geers||grass}}, Saterfriesisch {{m|stq|G√§√§rs||grass}}, West frisian {{m|fy|gers||grass}}, Low german {{m|nds|Gras||grass}}, Dutch {{m|nl|gras||grass, turf, pasture}}, German {{m|de|Gras||grass, weed}}, Danish {{m|da|gr√¶s||grass}}, Swedish {{m|sv|gr√§s||grass}}, Faroese {{m|fo|gras}}, Icelandic {{m|is|gras||grass}}, Latin {{m|la|herba||plant, weed, grass}}, Albanian {{m|sq|grath||grass blade, spike}}. Related to \u0027grow\u0027, \u0027green\u0027.{{rel-bottom}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|right|Grass\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any plant of the family Poaceae, characterized by leaves that arise from nodes in the stem and leaf bases that wrap around the stem, especially those grown as ground cover rather than for grain\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s chapter\u003d1|passage\u003d\u0027Twas early June, the new \u0027\u0027grass\u0027\u0027 was flourishing everywheres, the posies in the yard‚Äîpeonies and such‚Äîin full bloom, the sun was shining, and the water of the bay was blue, with light green streaks where the shoal showed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Various plants not in family Poaceae that resemble grasses\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A lawn\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Marijuana\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An informer, police informer; one who betrays a group (of criminals, etc) to the authorities\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Sharp, closely spaced discontinuities in the trace of a cathode-ray tube, produced by random interference\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Noise on an A-scope or similar type of radar display\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The season of fresh grass; spring\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Latha\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"two years old next \u0027\u0027grass\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"That which is transitory\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Bible Is. xl\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Surely the people is \u0027\u0027grass\", \"priority\":15}]}, \"synonyms\":{}}");

	add("graser", "{\"term\":\"graser\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{acronym of|gamma ray|Gamma Ray amplification|Amplification by the stimulated|Stimulated emission|Emission of radiation|Radiation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device for the coherent amplification or generation of electromagnetic radiation in the gamma ray wavelength by the use of excitation energy in resonant atomic or molecular systems\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The beam of coherent gamma rays produced by such a device\", \"priority\":2}]}, \"synonyms\":{}}");

