	add("gratification", "{\"term\":\"gratification\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027gratification\u0027 from Latin \u0027grƒÅtificƒÅti≈ç\u0027 from Latin \u0027gratificare\u0027 (to do a favor to, oblige, please, gratify) from \u0027gratus\u0027 () + \u0027facere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of gratifying, or pleasing, either the mind, the taste, or the appetite; as, the gratification of the palate, of the appetites, of the senses, of the desires, of the heart\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which affords pleasure; satisfaction; enjoyment; fruition: delight\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A reward; a recompense; a gratuity\", \"priority\":3}]}, \"synonyms\":{}}");

